    (78, 'e89b946f-9866-44d3-90ac-bf9b3492677c', 0, 'entitysubtype-internetdomainlabel-subdomain', 20, '', 'Subdomain', 'Further "divisions" within a second-level domain (SLD), often used to organize different sections of an Internet site or service, e.g., mail.example.com or app.example.com', 'Sub', '', -1, true, '00000000-0000-0000-0000-000000000000', 'f5e99d1e57a3b2c49cccb1339b0223c3bc4e88157efdde2d13483872e4b3fea7', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (79, '85c9c842-f8dd-4d62-abba-ff548183611d', 0, 'entitysubtype-telephonenumber-local', 22, '', 'Local', 'A telephone number that is associated with a specific geographic region or city, as indicated by its area code (often a "landline" number)', 'Loc', '', -1, true, '00000000-0000-0000-0000-000000000000', 'd59757f7e1584af442387da821601fdb1d5b902e08aeaa876f4899bbe5d18a1b', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (80, '6f804c5e-43e5-4f8d-90b2-9426d8396c78', 0, 'entitysubtype-telephonenumber-mobile', 22, '', 'Mobile', 'A telephone number that is associated with a cellular phone and linked to a Subscriber Identity Module (SIM) card or virtual equivalent and used to make and receive calls and Short Message Service (SMS) text messages from locations with cellular network coverage', 'Mob', '', -1, true, '00000000-0000-0000-0000-000000000000', '26e2499beb5c20f23bb94991cbcf0224cf84d1fca799c22ce2b9d62cd711c5e8', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (81, 'd39e55b2-16e3-4ef9-9835-5000b036475a', 0, 'entitysubtype-telephonenumber-tollfree', 22, '', 'Tollfree', 'A telephone number is paid for by the organization that receives the calls, enabling callers to reach an organization without incurring any call charges, often used for customer service or sales support', 'Tollfree', '', -1, true, '00000000-0000-0000-0000-000000000000', '3c7a4682ff5e08616173068a8747a58ca3f91e85772c0a022540409421e59a5c', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (82, 'd4581c8b-7b79-4eab-8e37-323e1e1aa0f3', 0, 'entitysubtype-emailaddress-addresswithdisplayname', 23, '', 'AddressWithDisplayName', 'Per Internet Engineering Task Force (IETF) Request for Comment (RFC) 5322, a mailbox can be either a name-addr, which contains a display-name and addr-spec, or the more common addr-spec only', 'Adr w Nam', '', -1, true, '00000000-0000-0000-0000-000000000000', 'ba1d0370460ba277020c8ee38fc788d931eb7c652e373db0ea1c16c07a7a40b0', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (83, '92b74a8b-2ac8-4a08-b04e-742bf161e176', 0, 'entitysubtype-emailaddress-addressonly', 23, '', 'AddressOnly', 'Per Internet Engineering Task Force (IETF) Request for Comment (RFC) 5322, a mailbox can be either a name-addr, which contains a display-name and addr-spec, or the more common addr-spec only', 'Adr Only', '', -1, true, '00000000-0000-0000-0000-000000000000', 'aa5aa924999d9330638cd1bb9f75f86435fe5938ad8cb40ad72e6584ace142fd', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (84, '94d23e7f-456b-4016-8582-07e27bb10b3f', 0, 'entitysubtype-uniformresourceidentifier-uniformresourcelocator', 24, '', 'UniformResourceLocator', 'A Uniform Resource Locator (URL) is a specific type of URI that also indicates how to access the resource.  In this case, this is specified using the EntitySubtype value.  An EntitySubtype value of 0 (None) indicates a URI, rather than a URL.', 'URL', '', -1, true, '00000000-0000-0000-0000-000000000000', '504f8c5db9b580e531c8fad5a37b209f04ddac63041e0b3cc4c1ad3eea2ca262', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (85, '566e9379-86f5-4d6a-82a9-59b99fb5b033', 0, 'entitysubtype-informationsystem-webapplication', 25, '', 'WebApplication', 'A worldwide web (WWW)-based system, accessed remotely using a web browser via the HTTP or HTTPS Internet protocols', 'Web', '', -1, true, '00000000-0000-0000-0000-000000000000', '53f4df5037546e1caa8c2ef506adeef37cae61eafdab3a86228cfdb536f00495', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (86, '8c3434b8-b17d-4707-91a4-7477a45952e2', 0, 'entitysubtype-informationsystem-mobileapp', 25, '', 'MobileApp', 'A system that runs natively on the operating system (OS) of a mobile device and that may interact with remote resources over a cellular or data network', 'Mobile', '', -1, true, '00000000-0000-0000-0000-000000000000', '23ee520a1434f92e16ba85193297ceaefedc9add2b30e9a9c3028dc16d106d6c', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (87, 'e5b89afa-11cc-4845-9d86-2efdf0b271ea', 0, 'entitysubtype-informationsystem-desktopapplication', 25, '', 'DesktopApplication', 'A system that runs natively on the operating system (OS) or a desktop computer or workstation and that may interact with remote resources over a data network', 'Desktop', '', -1, true, '00000000-0000-0000-0000-000000000000', '6fbb7d6640ae29c358334a37fb85e98e685d089fd009db6be970bc5e663d12cb', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (88, '39917a80-8663-4bc3-97ba-f8977f7448bf', 0, 'entitysubtype-informationsystem-apiservice', 25, '', 'ApiService', 'An application programming interface (API) service, accessed by a client system to interact with external data and functionality', 'API', '', -1, true, '00000000-0000-0000-0000-000000000000', '557b39642f6e2acf37cd5330d6ce79e1cb4aaa93930e51ae5fa1be7a392d7443', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (89, '68d92603-3b77-4935-957a-96bd2a2810c1', 0, 'entitysubtype-informationsystem-database', 25, '', 'Database', 'A data persistence (storage and retrieval) system, accessed locally or remotely using a client application or service via proprietary or standard protocols', 'DB', '', -1, true, '00000000-0000-0000-0000-000000000000', '40d68f4d65cb4fb39bacdafc3270778524c2eb909ea0407249307bfb6a05a584', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (90, '7dd71fdc-f242-4fdc-bfe2-87226c167b74', 0, 'entitysubtype-informationsystem-marketing', 25, 'Purpose', 'Marketing', 'Systems intended to help an organization to promote its products or services by understanding customer needs, establishing the value of these products and services, communicating that value to the target audience(s), connecting with customers, and building relationshipsin order to drive business success.', 'Mktg', '', -1, true, '00000000-0000-0000-0000-000000000000', 'd6536ba043dd790a2ea8e0061c1532c29e8d98c81bda3eb3c1478e597103628c', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (91, '70cbbaf7-ed73-44d9-b6e1-52eaeaabdffb', 0, 'entitysubtype-informationsystem-businesstoconsumercommerce', 25, 'Purpose', 'BusinessToConsumerCommerce', 'Systems intended to sell products or services directly from an organization to an individual consumer for personal use, i.e. online retail, often collecting and leveraging customer data in order to offer personalized experiences and upsell and cross-sell opportunities.', 'B2C', '', -1, true, '00000000-0000-0000-0000-000000000000', '42e1dd4ea4e996fa9306df27df6255da2ef1f01582bc9b585e33698a441d971f', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (92, 'cdf34ea5-5839-4b45-89f1-78bd200d4b56', 0, 'entitysubtype-informationsystem-businesstobusinesscommerce', 25, 'Purpose', 'BusinessToBusinessCommerce', 'Systems intended to sell products or services created or delivered by an organization to other organizations, while improving efficiency and effectiveness in the sales processes, order management, and supply chain operation.', 'B2B', '', -1, true, '00000000-0000-0000-0000-000000000000', 'f2e68043a772a57afd61f8bd70689c7a2e7e51b84b4dcb6ec3045b66b0ab347b', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (93, 'd9205507-e23f-42cd-9a2e-7290461adc5c', 0, 'entitysubtype-informationsystem-officeautomation', 25, 'Purpose', 'OfficeAutomation', 'Systems intended to streamline and automate repetitive, day-to-day tasks in an office environment, including digitizing, storing, processing, and transferring information electronically, ultimately improving efficiency, productivity, and accuracy, e.g. word processing, data entry, document management, report generation, etc.  Specific examples include word processors, spreadsheets, file storage and search, and report writing tools.', 'Ofc Autom', '', -1, true, '00000000-0000-0000-0000-000000000000', '7d2914b94189acc34661fd579f38f89ef6595f8dc2cd5dd40caf542353ac86b3', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (94, '0ec2db57-5938-4311-8fec-b3bb59a83044', 0, 'entitysubtype-informationsystem-operationalefficiency', 25, 'Purpose', 'OperationalEfficiency', 'Systems intended to help an organization utilize its resources efficiently by maximizing output while minimizing input (cost, time, and other resources), optimizing processes, and reducing waste to achieve business objectives effectively.  Specific examples include enterprise resource planning (ERP), human relations (HR), customer relationship management (CRM), knowledge management (KM), data analytics, and decision support.', 'Op Eff', '', -1, true, '00000000-0000-0000-0000-000000000000', 'a5bd033b4a25671878458ec7b7fc692180bd3bd87ef7ca221eeedf2cf6e4b2bb', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (95, '99702890-4b7e-433d-8d4a-6c351b24f263', 0, 'entitysubtype-informationsystem-communicationandcollaboration', 25, 'Purpose', 'CommunicationAndCollaboration', 'Systems intended to promote effective teamwork and achieving shared goals by sharing information, building relationships, persuading and building consensus, working together, brainstorming, reviewing results, etc.  Specific examples include email communication, instant messaging, scheduling, presentation software, and whiteboarding.', 'Comm & Collab', '', -1, true, '00000000-0000-0000-0000-000000000000', 'e9e8394d17752fba1d8981537b37c6232c91e79ccdb58aa9d32ac0f22872aeb0', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (96, 'd026162d-b19e-47ae-8fd4-58aa4f108965', 0, 'entitysubtype-informationsystem-customerservice', 25, 'Purpose', 'CustomerService', 'Systems intended to support and assist an organization''s customers and stakeholder, both before and after a demonstration, evaluation, purchase, etc in order to meet customer needs, resolve issues, and ultimately creating a positive experience and fostering loyalty.  Good customer service impactd customer satisfaction, retention, and brand perception.', 'Cust Svc', '', -1, true, '00000000-0000-0000-0000-000000000000', 'e79c692a7703d9fe4def2660bc3344c130001759f0d83cf031cb08e5e0630236', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (97, '4dafb81a-ee6b-4e59-9a1c-09519542435e', 0, 'entitysubtype-informationsystem-entertainment', 25, 'Purpose', 'Entertainment', 'Systems intended to provide activities or events, e.g. movies, television shows, music, live performances, games, books, social media, etc, that hold the attention of the participant or audience and that provide enjoyment, pleasure, or diversion in order to offer amusement, relaxation, and a break from daily routines.', 'Ent', '', -1, true, '00000000-0000-0000-0000-000000000000', 'cfc4787ffecfe7a22a64dd84d90f047f0bd2d7eb0eb9bd3f3aca57078c3c99e5', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (98, 'a4493b82-4cfb-4668-8c52-46b95beb6898', 0, 'entitysubtype-informationsystem-education', 25, 'Purpose', 'Education', 'Systems intended to transmit knowledge and skills and to develop character traits. Education can be either formal, occurring within a structured institutional framework, such as public schools, and following a curriculum, or informal, occurring outside the formal schooling system and involving unstructured learning through study and experience.', 'Edu', '', -1, true, '00000000-0000-0000-0000-000000000000', '6a2882ebd59a40a48d22f92b90c3c12f4061689a6e9c2d3c3db47da546fe82e6', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (99, 'ba0bfb98-4f19-4231-bc59-54089158b58a', 0, 'entitysubtype-informationsystem-search', 25, 'Purpose', 'Search', 'Systems intended to locate local or remote information or resources based on classification, keyword, context, relevance, etc provided by the user.', 'Srch', '', -1, true, '00000000-0000-0000-0000-000000000000', 'f7f799ac6ca93c85fd3cd77830091044789e0128c582cd263b030227436096fc', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (100, 'c7fa046f-4d66-4721-832e-6cd82e58fb45', 0, 'entitysubtype-informationsystem-design', 25, 'Purpose', 'Design', 'Typically personal productivity tools intended to help an individual to conceptualize, decide upon, refine, and optimzie the structure, appearance, and functionality of an object or system, often based on a set of requirements.  Collaborative or team tools are typically considered communication and collaboration systems.', 'Dsgn', '', -1, true, '00000000-0000-0000-0000-000000000000', 'c1605a83f15e6a0645debf5a97c0e2ee6f303a4eb2b23508cbab6e504e10cc91', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (101, 'c7fd3bb4-74c4-457e-a042-009b478606a4', 0, 'entitysubtype-informationsystem-creation', 25, 'Purpose', 'Creation', 'Typically personal productivity tools intended to help an individual to realize the structure, appearance, and functionality of an object or system, based on a design and/or set of requirements.  Collaborative or team tools are typically considered communication and collaboration systems.', 'Creat', '', -1, true, '00000000-0000-0000-0000-000000000000', 'c24980c1c8fabd3c6211b569819f28b68e17443aa2cd7ecd6deaf73db38c8f0a', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (102, 'ac19f281-9c8e-4f7c-9d57-e1f444883237', 0, 'entitysubtype-informationsystem-webapplicationframework', 25, 'Technology', 'WebApplicationFramework', 'A web application created with a framework -- an integrated collection of software components designed to support the development of web applications by establishing a standardized but extensible program structure, providing default behaviors, and maintaining a core that supports extensions without direct modification.  Web application frameworks are typically (but not necessarily) used to create 2-tier, client-server, applications.  They promote code reuse and provide a standard way to build and deploy web applications on the World Wide Web.', 'WAF', '', -1, true, '00000000-0000-0000-0000-000000000000', 'f5cf35d6e268d141935281ad499ec6130f9fdf1768ceb91d7f237cffe9997f4e', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (103, '44b793b5-907e-4e25-8ccb-c6c32e5ed750', 0, 'entitysubtype-informationsystem-progressivewebapplication', 25, 'Technology', 'ProgressiveWebApplication', 'A web application, created with HTML, CSS, and JavaScript, that can be installed on a user device and provides a native application experience, while remaining accessible through a web browser.', 'PWA', '', -1, true, '00000000-0000-0000-0000-000000000000', 'bf61349ace0efc33f6f24fa7cac69f4d8310394f3b4a680e718325a92625c39a', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (104, '186e5a6e-7b93-483a-92d9-75958ce233ed', 0, 'entitysubtype-informationsystem-applicationframework', 25, 'Technology', 'ApplicationFramework', 'An application created with a framework -- an integrated collection of software components designed to support the development of applications by establishing a standardized but extensible program structure, providing default behaviors, and maintaining a core that supports extensions without direct modification.  Application frameworks are typically (but not necessarily) used to create the service and data layers, i.e. APIs, services, and data structures, of 3-tier applications.  They promote code reuse and provide a standard way to build and deploy web applications on the World Wide Web.', 'App Frmwk', '', -1, true, '00000000-0000-0000-0000-000000000000', 'b02357301bd087fd2fa564c26a9ddd9581b9bbda6c04b5b87af437140e7aaaa7', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (105, '9811effa-03c2-486b-95a2-70414a41bd23', 0, 'entitysubtype-informationsystem-dataplatform', 25, 'Technology', 'DataPlatform', 'An integrated set of technologies that enable the collection, storage, processing, analysis, and governance of data and that acts as a central hub for all data-related activities within an organization, facilitating efficient data management and utilization for various purposes.', 'Dat Pltfm', '', -1, true, '00000000-0000-0000-0000-000000000000', 'fdd684b18f3f095b2fb3bf8936a44a5db16c3b769792cd541910f4c22ccfe73a', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (106, '9eff6173-1baa-4595-aa79-d24fc891cb15', 0, 'entitysubtype-contentitem-asciitext', 26, '', 'AsciiText', 'American Standard Code for Information Interchange (ASCII) text uses the ASCII 7-bit character set to represent 128 characters, including English letters, numbers, punctuation, and control characters.  It was a foundational standard for computers and electronic devices.  While ASCII has been largely replaced by Unicode, it continues to be relevant and is the basis for the first 128 code points of Unicode.', 'ASCII', '', -1, true, '00000000-0000-0000-0000-000000000000', 'a0def7e114afcf92c470bb4c43c2e6f81bc58004e4dff56a9087ba30193a5a93', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (107, 'bbcdd8ee-ef1f-46ab-9e8a-076a6644d4df', 0, 'entitysubtype-contentitem-base64encodeddata', 26, '', 'Base64EncodedData', 'Base64 is a binary-to-text encoding scheme that renders binary data as a sequence of printable characters in order to embed image files or other binary data inside textual assets such as HTML and CSS files.', 'Base64', '', -1, true, '00000000-0000-0000-0000-000000000000', '508bfb2be1db126b77684934d0c7234846d2b18cf6f99f14a573c71a3561f6d7', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (108, 'a20540f5-9173-47a6-b4b7-e8949b791cc4', 0, 'entitysubtype-contentitem-html4fragment', 26, '', 'Html4Fragment', 'An HTML fragment is not a complete HTML document. Fragments are used to include HTML content within other web pages or content management systems.  HTML 4 fragments exhibit the older, literal elements such as <p>, <b>, <div>, etc, focused on creating display structures like tables and explicitly styling them.', 'HTML 4', '', -1, true, '00000000-0000-0000-0000-000000000000', 'a27e73f86de0cbac81bbc986f05fc9cccbca7809ccada69434c50392617bbe50', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (109, '9e9cf2cd-84ea-4a92-b5e5-5315ca774bb9', 0, 'entitysubtype-contentitem-html5fragment', 26, '', 'Html5Fragment', 'An HTML fragment is not a complete HTML document. Fragments are used to include HTML content within other web pages or content management systems.  HTML 5 fragements include the newer, semantic elements such as <header>, <section>, <footer>, etc, which provide meaningful page structure that can be styled implicitly and/or with the use of stylesheets.', 'HTML 5', '', -1, true, '00000000-0000-0000-0000-000000000000', '6c35fba225993306f301187adf9227ce506e51020f78fce1b91195d185cd4ab0', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0),
    (110, 'aa377bab-3c0f-4a7e-9f46-85d7d9d0b291', 0, 'entitysubtype-contentitem-markdown', 26, '', 'Markdown', 'Markdown is a lightweight markup language that uses plain text formatting to create rich text documents. It is designed to be easy to read, write, and understand without rendering the document. Markdown is often used for creating documentation, website content, and formatted text in online forums and platforms like GitHub.', 'Mrkdwn', '', -1, true, '00000000-0000-0000-0000-000000000000', '0bd07a04bec68b1fd6cb84176bf56310f71a6a0a860267466616ea8a47ab954b', '2022-06-01 00:00:00.000', 0, '2022-06-01 00:00:00.000', 0, '9999-12-31 23:59:59.999', 0)
